.w-dia {
  .el-dialog__body {
    padding: 1px 20px;
    padding-left: 35px;
    height: 400px;
    overflow: auto;
  }
  .el-dialog__title {
    font-size: 14px;
  }
}

.dia-content {
  display: flex;
  font-family: "Helvetica Neue", Helvetica, "PingFang SC", "Hiragino Sans GB",
    "Microsoft YaHei", "微软雅黑", Arial, sans-serif;
  font-size: 12px;
  flex-direction: row;
  flex-wrap: wrap;
  .c-data {
    width: 50%;
    margin-bottom: 30px;
    .c-title {
      font-weight: 800;
      margin-bottom: 10px;
    }
    .el-select--mini {
      width: 100%;
    }
    .el-cascader--mini {
      width: 100%;
      .el-input__suffix {
        right: -6px;
      }
    }
    .ct-item {
      display: flex;
      flex-direction: row;
      text-align-last: justify;
      align-items: center;
      margin-bottom: 3px;
      .c-input {
        width: 70%;
      }

      .d_code {
        display: flex;
        flex-direction: row;
        width: 69%;
        .el-select {
          width: 50%;
        }
      }
      .label {
        width: 23%;
        margin-right: 10px;
      }
    }
  }
}

