.n-post {
  z-index: 9999;
  .pagination-container {
    border-top: 1px solid #e4e7ed;
  }
  .nc {
    border-bottom: 1px solid #e4e7ed;
    margin-bottom: 10px;
  }
  .el-form-item--mini.el-form-item {
    margin-bottom: 3px;
  }
  .table {
    margin-bottom: 10px;
  }
  .el-dialog__header {
    padding: 20px;
    padding-bottom: 5px;
    padding-top: 5px;
  }
  .el-dialog__body {
    padding: 10px 10px;
    .el-form-item__label {
      font-weight: 400;
      font-size: 12px;
    }
    .filed-span {
      height: 20px;
      line-height: 20px;
    }
  }
  .el-dialog {
    margin-top: 5vh !important;
  }
}

